01273690472461","attachments":[],"embeds":[],"timestamp":"2018-05-20T23:19:45.251000+00:00","edited_timestamp":null,"content":"\u003c@446251035623817217> Eigentlich soll man jedes Leben ehren. Selbst die M\u00fccke. Da gibt es auch ne Sure zu. Man darf als Muslim ja nicht mal nem Baum f\u00e4llen. Ich glaub die Ausnahme sind nur Tiere, die verzehrt werden (Wiederk\u00e4uer mit gespaltenen Hufen)","author":29,"s":13553,"mentions":[27]},{"id":"447901293206568960","attachments":[],"embeds":[],"timestamp":"2018-05-20T23:19:49.904000+00:00","edited_timestamp":null,"content":"hatte dazu was in der Lounge erz\u00e4hlt","author":27,"s":13554,"mentions":[]},{"id":"447901483002888212","attachments":[],"embeds":[],"timestamp":"2018-05-20T23:20:35.155000+00:00","edited_timestamp":null,"content":"\u003c@446251035623817217> du sollst der intolerante gewesen sein\nAch so \ud83d\ude05","author":29,"s":13555,"mentions":[27]},{"id":"447901914219413514","attachments":[],"embeds":[],"timestamp":"2018-05-20T23:22:17.965000+00:00","edited_timestamp":null,"content":"muss mich nun auch mal verabschieden \ud83d\ude09 Gute Nacht!  Kannst dir das Ganze aber hier ansehen: https://www.facebook.com/groups/254000588102616/","author":27,"s":13556,"mentions":[]},{"id":"447901990358614017","attachments":[],"embeds":[],"timestamp":"2018-05-20T23:22:36.118000+00:00","edited_timestamp":null,"content":"Nacht \ud83d\udc4b\ud83c\udffc","author":29,"s":13557,"mentions":[]},{"id":"447902010344210452","attachments":[],"embeds":[],"timestamp":"2018-05-20T23:22:40.883000+00:00","edited_timestamp":null,"content":"Danke","author":29,"s":13558,"mentions":[]},{"id":"448287801327484928","attachments":[],"embeds":[],"timestamp":"2018-05-22T00:55:40.621000+00:00","edited_timestamp":null,"reactions":[{"count":3,"emoji":{"name":"\u2753"}}],"content":"DIE SYMPTOME\n\nDas Syndrom scheint sich bei Menschen zu entwickeln, die jahrelang einen sehr hohen Cannabiskonsum pflegen. Der Beginn der Symptome kann eigentlich sehr langsam sein; eine Studie, die von der Philadelphia PA durchgef\u00fchrt wurde, zeigt, dass die durchschnittliche Zeit, bevor die Symptome auftreten, erst nach ungef\u00e4hr 16 Jahren ist. Im fr\u00fchesten Fall, der untersucht wurde, trat das Syndrom nach drei Jahren von t\u00e4glichem, hohem Cannabiskonsum auf.\n\nDie Symptome k\u00f6nnen in drei Stadien unterteilt werden: Eine pr\u00e4emetische Phase, eine hyperemetische Phase und schlie\u00dflich eine Genesung. In der pr\u00e4emetischen Phase treten die ersten Symptome auf, auch wenn sie eher schwach sind. Diese Phase kann mehrere Jahre andauern. Die ersten auftretenden Symptome sind normalerweise die Angst sich zu \u00fcbergeben, Bauchbeschwerden und \u00dcbelkeit. Diese Symptome f\u00fchren normalerweise zu einem erh\u00f6hten Cannabiskonsum, wegen dem Glauben, dass Cannabis \u00dcbelkeit lindern kann.\n\nDarauf folgt die hyperemetische Phase, welche den H\u00f6hepunkt der Symptome darstellt. Sie ist normalerweise k\u00fcrzer und h\u00e4lt zwischen 24 und 48 Stunden an, w\u00e4hrend denen der Patient pl\u00f6tzliche Perioden von intensivem Erbrechen und intensiver \u00dcbelkeit erlebt. Das Erbrechen kann bis zu f\u00fcnfmal pro Stunde aufkommen und wird mit Dehydratation, Bauchschmerzen und Gewichtsverlust einhergehen.\n\nDie letzte Phase ist die Genesung, in der die Symptome verschwinden und die Patienten wieder an Gewicht gewinnen, weil ihr Appetit wieder zur\u00fcckkehrt. Die Genesungsphase kann Monate dauern, doch weil die meisten Patienten wieder in ihrem alten Cannabiskonsum verfallen, ist es nur eine Frage der Zeit, bis die Symptome von neuem beginnen und der Patient einen R\u00fcckfall erleidet.","author":20,"s":13559,"mentions":[]},{"id":"448287898282754050","attachments":[],"embeds":[],"timestamp":"2018-05-22T00:56:03.737000+00:00","edited_timestamp":null,"content":"quelle: royalqueenseeds.de/blog-was-ist-das-cannabis-hyperemesis-syndrom-n506","author":20,"s":13560,"mentions":[]},{"id":"448369986897969 \n\nErgebnis: Bei der Frage, Wer w\u00fcrde das nochmal so machen wollen?,  gab es kaum Zuspruch.\nEvtl. kann man das Netzthema unabh\u00e4ngig vom Stream als Twitter-Aktion thematisieren und so mit einem Konsens starten. \nEs f\u00e4llt uns kein Ziel ein, was wir mit diesem Mittel erreichen k\u00f6nnen. \n\nSollte sich ein solches Gespr\u00e4ch nocheinmal ereignen, hier unsere Gedanken:\n\n\nUnter welchen Bedingungen m\u00fcsste ein solches Gespr\u00e4ch stattfinden:\n\n- Keine Beleidigungen im Chat\n- Spa\u00df\n- Redeliste \n- Nacheinander abarbeiten\n- Keine Unterstellungen\n- Ja / Nein Fragen nicht nur\n- Vorab Fragen geben lassen/Fragekatalog erstellen\n- Das heutige Gespr\u00e4ch muss ausgiebig analysiert werden.\n- Eine strategische Positionierung w\u00e4re wichtig \n- LiveStream an sich? Ist das das richtige Medium? \u00d6ffentlich?\n- eher nicht so \n\n\nVorfragen?\nKlares Ziel, Was wollen wir damit erreichen?\nwollen wir uns nur verteidigen? \nWollen wir selbst in den Angriff gehen?\nBei denen Treffen?\nModeration abgeben? Wir Moderieren? \nModeration Teilen?\n\n\nInhaltlich wichtige Positionen\n1)Wir m\u00fcssen klarstellen, dass B\u00f6hmermann nichts mit RI zu tun hat, \nau\u00dfer dass er es ins Leben gerufen hat, aber wir rechtfertigen uns nicht f\u00fcr seine Satire oder so...\nb) Er ist hier nur als Privat Person unterwegs)\nFlauschangriffe, sind freiwillig und jeder darf und soll Aktionen hinterfragen, auf jeden, wir sind alle kritische Einzelpersonen & folgen nicht stumpf iwem/iwas","author":37,"s":13866,"mentions":[]},{"id":"448973957819793418","attachments":[],"embeds":[],"timestamp":"2018-05-23T22:22:13.077000+00:00","edited_timestamp":null,"reactions":[{"count":1,"emoji":{"name":"thumbonfire"}}],"content":"Was m\u00fcssen wir k\u00f6nnen?\n-Schlagkr\u00e4ftig Argumnentieren k\u00f6nnen.\n- Gute Themenkenntnis der Mut zur L\u00fccke\n-Bessere Teamaufstellung\n-Wir m\u00fcssten auch Agieren k\u00f6nnen\n-Mal ein Thema ansprechen k\u00f6nnen, wo
